        void
        CM_Struc_Nonlinear_Isotropic_Compressible_Neo_Hookean_Bonet::eval_traction_second_piola_kirchhoff(
                const Matrix< DDRMat >& aNormal )
        {
            // get second Piola-Kirchhoff stress in full notation
            Matrix< DDRMat > t2PKStressFull;
            this->voigt_to_full_sym_stress( this->flux( CM_Function_Type::PK2 ), t2PKStressFull );

            // evaluate traction based on second Piola-Kirchhoff stress
            m2PKTraction = t2PKStressFull * aNormal;
        }

        //--------------------------------------------------------------------------------------------------------------

        void
        CM_Struc_Nonlinear_Isotropic_Compressible_Neo_Hookean_Bonet::eval_traction_first_piola_kirchhoff(
                const Matrix< DDRMat >& aNormal )
        {
            // get first Piola-Kirchhoff stress in full notation
            Matrix< DDRMat > t1PKStressFull;
            this->voigt_to_full_nonsym( this->flux( CM_Function_Type::PK1 ), t1PKStressFull );

            // evaluate traction based on first Piola-Kirchhoff stress
            m1PKTraction = t1PKStressFull * aNormal;
        }

