        void
        CM_Struc_Nonlinear_Isotropic_Compressible_Neo_Hookean_Bonet::eval_testTraction_cauchy(
                const Matrix< DDRMat >&      aNormal,
                const Vector< MSI::Dof_Type >& aTestDofTypes )
        {
            // Need to retrieve normal in current configuration for traction based on Cauchy stress
            MORIS_ASSERT( false, "CM_Struc_Nonlinear_Isotropic_Compressible_Neo_Hookean_Bonet::eval_testTraction_cauchy - Not implemented." );
        }

