        //--------------------------------------------------------------------------------------------------------------

        void
        CM_Struc_Nonlinear_Isotropic_Compressible_Neo_Hookean_Bonet::full_plane_strain(
                const real& aEmod,
                const real& aNu )
        {
            // get the Poisson's ratio value
            const real tNu = mPropPoisson->val()( 0 );

            // get the Youngs' modulus value
            const real tEmod = mPropEMod->val()( 0 );

            // get the Lame's constants
            real tLam_p = tEmod * tNu / ( ( 1.0 + tNu ) * ( 1.0 - 2.0 * tNu ) );
            real tMu_p  = tEmod / ( 2.0 * ( 1.0 + tNu ) ) - tLam_p * std::log( this->volume_change_jacobian() );

            // unpack the components of the inverse of the right Cauchy-Green deformation tensor
            real tInvC11 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 0, 0 );
            real tInvC22 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 1, 0 );
            real tInvC12 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 2, 0 ) / 2.0;

            // Calculate the elasticity tensor based on
            // [Bonet & Wood 2008 - Nonlinear Continuum Mechanics for Finite Element Analysis 2nd Edition] eq. 6.30
            // mConst = lam * inv(Cij) (x) inv(Cij) + (mu-lamln(J))*(inv(Cik)*inv(Cil) + inv(Cil)*inv(Cjk))
            mConst( 0, 0 ) = ( tLam_p + 2.0 * tMu_p ) * tInvC11 * tInvC11;
            mConst( 0, 1 ) = tLam_p * tInvC11 * tInvC22 + 2.0 * tMu_p * tInvC12 * tInvC12;
            mConst( 0, 2 ) = ( tLam_p + 2.0 * tMu_p ) * tInvC11 * tInvC12;

            mConst( 1, 0 ) = mConst( 0, 1 );
            mConst( 1, 1 ) = ( tLam_p + 2.0 * tMu_p ) * tInvC22 * tInvC22;
            mConst( 1, 2 ) = ( tLam_p + 2.0 * tMu_p ) * tInvC22 * tInvC12;

            mConst( 2, 0 ) = mConst( 0, 2 );
            mConst( 2, 1 ) = mConst( 1, 2 );
            mConst( 2, 2 ) = tMu_p * ( tInvC11 * tInvC22 + tInvC12 * tInvC12 ) + tInvC12 * tInvC12 * tLam_p;
        }

