        void
        CM_Struc_Nonlinear_Isotropic_Compressible_Neo_Hookean_Bonet::full_3d(
                const real& aEmod,
                const real& aNu )
        {
            // get the Poisson's ratio value
            const real tNu = mPropPoisson->val()( 0 );

            // get the Youngs' modulus value
            const real tEmod = mPropEMod->val()( 0 );

            // get the Lame's constants
            real tLam_p = tEmod * tNu / ( ( 1.0 + tNu ) * ( 1.0 - 2.0 * tNu ) );
            real tMu_p  = tEmod / ( 2.0 * ( 1.0 + tNu ) ) - tLam_p * std::log( this->volume_change_jacobian() );

            // unpack the components of the right Cauchy-Green deformation tensor
            real tInvC11 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 0, 0 );
            real tInvC22 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 1, 0 );
            real tInvC33 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 2, 0 );
            real tInvC23 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 3, 0 ) / 2.0;
            real tInvC13 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 4, 0 ) / 2.0;
            real tInvC12 = this->strain( CM_Function_Type::INV_RIGHT_CAUCHY_GREEN )( 5, 0 ) / 2.0;

            // Calculate the elasticity tensor based on
            // [Bonet & Wood 2008 - Nonlinear Continuum Mechanics for Finite Element Analysis 2nd Edition] eq. 6.30
            // mConst = lam * inv(Cij) (x) inv(Cij) + (mu-ln(J))*(inv(Cik)*inv(Cil) + inv(Cil)*inv(Cjk))
            // compute components of the constitutive tensor 2*dSijdCkl
            mConst( 0, 0 ) = ( tLam_p + 2.0 * tMu_p ) * tInvC11 * tInvC11;
            mConst( 0, 1 ) = tLam_p * tInvC11 * tInvC22 + 2.0 * tMu_p * tInvC12 * tInvC12;
            mConst( 0, 2 ) = tLam_p * tInvC11 * tInvC33 + 2.0 * tMu_p * tInvC13 * tInvC13;
            mConst( 0, 3 ) = tLam_p * tInvC11 * tInvC23 + 2.0 * tMu_p * tInvC12 * tInvC13;
            mConst( 0, 4 ) = tLam_p * tInvC11 * tInvC13 + 2.0 * tMu_p * tInvC11 * tInvC13;
            mConst( 0, 5 ) = tLam_p * tInvC11 * tInvC12 + 2.0 * tMu_p * tInvC11 * tInvC12;

            mConst( 1, 0 ) = mConst( 0, 1 );
            mConst( 1, 1 ) = ( tLam_p + 2.0 * tMu_p ) * tInvC22 * tInvC22;
            mConst( 1, 2 ) = tLam_p * tInvC22 * tInvC33 + 2.0 * tMu_p * tInvC23 * tInvC23;
            mConst( 1, 3 ) = tLam_p * tInvC22 * tInvC23 + 2.0 * tMu_p * tInvC22 * tInvC23;
            mConst( 1, 4 ) = tLam_p * tInvC22 * tInvC13 + 2.0 * tMu_p * tInvC12 * tInvC23;
            mConst( 1, 5 ) = tLam_p * tInvC22 * tInvC12 + 2.0 * tMu_p * tInvC12 * tInvC22;

            mConst( 2, 0 ) = mConst( 0, 2 );
            mConst( 2, 1 ) = mConst( 1, 2 );
            mConst( 2, 2 ) = ( tLam_p + 2.0 * tMu_p ) * tInvC33 * tInvC33;
            mConst( 2, 3 ) = tLam_p * tInvC33 * tInvC23 + 2.0 * tMu_p * tInvC23 * tInvC33;
            mConst( 2, 4 ) = tLam_p * tInvC33 * tInvC13 + 2.0 * tMu_p * tInvC13 * tInvC33;
            mConst( 2, 5 ) = tLam_p * tInvC33 * tInvC12 + 2.0 * tMu_p * tInvC13 * tInvC23;
                                    
            mConst( 3, 0 ) = mConst( 0, 3 );
            mConst( 3, 1 ) = mConst( 1, 3 );
            mConst( 3, 2 ) = mConst( 2, 3 );
            mConst( 3, 3 ) = tLam_p * tInvC23 * tInvC23 + tMu_p * ( tInvC23 * tInvC23 + tInvC33 * tInvC22 );
            mConst( 3, 4 ) = tLam_p * tInvC23 * tInvC13 + tMu_p * ( tInvC13 * tInvC23 + tInvC33 * tInvC12 );
            mConst( 3, 5 ) = tLam_p * tInvC23 * tInvC12 + tMu_p * ( tInvC13 * tInvC22 + tInvC23 * tInvC12 );
                                   
            mConst( 4, 0 ) = mConst( 0, 4 );
            mConst( 4, 1 ) = mConst( 1, 4 );
            mConst( 4, 2 ) = mConst( 2, 4 );
            mConst( 4, 3 ) = mConst( 3, 4 );
            mConst( 4, 4 ) = tLam_p * tInvC13 * tInvC13 + tMu_p * ( tInvC13 * tInvC13 + tInvC33 * tInvC11 );
            mConst( 4, 5 ) = tLam_p * tInvC13 * tInvC12 + tMu_p * ( tInvC13 * tInvC12 + tInvC23 * tInvC11 );

            mConst( 5, 0 ) = mConst( 0, 5 );
            mConst( 5, 1 ) = mConst( 1, 5 );
            mConst( 5, 2 ) = mConst( 2, 5 );
            mConst( 5, 3 ) = mConst( 3, 5 );
            mConst( 5, 4 ) = mConst( 4, 5 );
            mConst( 5, 5 ) = tLam_p * tInvC12 * tInvC12 + tMu_p * ( tInvC11 * tInvC22 + tInvC12 * tInvC12 );
        }

